import React, { useEffect, useState } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import { Box, Typography, TextField, Button, CircularProgress, Grid } from '@mui/material';
import { searchByNameAction, fetchBoothNamesAction } from '../redux/actions/action';
import { Icon } from "@iconify/react";
import Autocomplete from '@mui/material/Autocomplete';
import VoterTable from './VoterTable';
import AllDataComponent from './AllDataComponent';
import CastedDataComponent from './CastedDataComponent';
import NotCastedDataComponent from './NotCastedDataComponent';

const VolunteerData = () => {
  const dispatch = useDispatch();
  const [searchName, setSearchName] = useState('');
  const [searched, setSearched] = useState(false);
  const [filteredVoters, setFilteredVoters] = useState([]);
  const [loading, setLoading] = useState(false);
  const [selectedBooth, setSelectedBooth] = useState('');
  const boothNames = useSelector((state) => state.boothNameReducer?.data || []);
  const voters = useSelector((state) => state.searchByNameReducer?.data);

  useEffect(() => {
    if (selectedBooth.trim() !== '') {
      dispatch(fetchBoothNamesAction(selectedBooth));
    }
  }, [selectedBooth, dispatch]);

  useEffect(() => {
    if (voters) {
      setFilteredVoters(voters.filter(item => !item.casted));
      const timer = setTimeout(() => {
        setLoading(false);
      }, 1000);
      return () => clearTimeout(timer);
    }
  }, [voters]);

  const handleSearch = () => {
    setLoading(true);
    dispatch(searchByNameAction(searchName, selectedBooth));
    setSearched(true);
  };

  const handleClear = () => {
    setSearchName('');
    setFilteredVoters([]);
    setSearched(false);
  };

  const handleInputBoothChange = (event, value) => {
    setSelectedBooth(value);
  };

  return (
    <Box sx={{ padding: 3 }}>
      <Grid container sx={{ padding: 3, display: 'flex', justifyContent: 'space-between' }}>
        <Grid item>
          <Box sx={{ borderRadius: '7px', backgroundColor: "white", padding: '2px 5px' }}>
            <Autocomplete
              disablePortal
              size="small"
              id="combo-box-demo"
              options={boothNames}
              onChange={handleInputBoothChange}
              sx={{ width: 300 }}
              renderInput={(params) => (
                <TextField
                  sx={{
                    "& .MuiOutlinedInput-root": {
                      "&.Mui-focused .MuiOutlinedInput-notchedOutline": {
                        borderColor: "#888888",
                      },
                      "&:hover .MuiOutlinedInput-notchedOutline": {
                        borderColor: "#888888",
                      },
                      "& .MuiOutlinedInput-notchedOutline": {
                        borderColor: "#888888",
                      }
                    }
                  }}
                  {...params} placeholder="Booth name"
                />
              )}
            />
          </Box>
        </Grid>
        <Grid item>
          <TextField
            size="small"
            placeholder="Search by entering a name"
            variant="outlined"
            autoComplete="off"
            value={searchName}
            onChange={(e) => setSearchName(e.target.value)}
            InputProps={{
              endAdornment: <Icon icon="material-symbols-light:search" width="25" height="25" style={{ color: 'black' }} />,
            }}
            sx={{
              "& .MuiOutlinedInput-root": {
                "&.Mui-focused .MuiOutlinedInput-notchedOutline": {
                  borderColor: "#3e4241",
                },
                "&:hover .MuiOutlinedInput-notchedOutline": {
                  borderColor: "#3e4241",
                },
                "& .MuiOutlinedInput-notchedOutline": { borderColor: "#3e4241", }
              },
              mr: 2
            }}
          />

          <Button
            variant="contained"
            onClick={handleSearch}
            sx={{
              backgroundColor: '#EE8832',
              color: 'white',
              fontWeight: 'bold',
              '&:hover': {
                backgroundColor: '#EE8832',
                color: 'white',
              },
            }}
          >
            Search
          </Button>
        </Grid>
      </Grid>

      {selectedBooth && (
        <>
          {searched ? (
            loading ? (
              <CircularProgress />
            ) : (
              filteredVoters.length === 0 ? (
                <Typography variant="h6" sx={{ marginTop: 2 }}>
                  No data available
                </Typography>
              ) : (
                <VoterTable voters={filteredVoters} />
              )
            )
          ) : (
            <AllDataComponent boothName={selectedBooth} />
          )}
        </>
      )}
    </Box>
  );
};

export default VolunteerData;
